import React from "react";

// Component
import Bio from "../Bio";
import { Wrapper, Content } from "./Person.styles";
// Router
import { useParams } from "react-router";

const Person = () => {
  const { personId } = useParams();
  return (
    <Wrapper>
      <Content>
        <div>Movies</div>
        <Bio personId={personId} />
      </Content>
    </Wrapper>
  );
};

export default Person;
